        if (pre == null) head = root;
        //\u5982\u679C\u4E0D\u4E3A\u7A7A\uFF0C\u90A3\u5C31\u8BF4\u660E\u662F\u4E2D\u95F4\u7684\u8282\u70B9\uFF0C\u5E76\u4E14pre\u4FDD\u5B58\u7684\u662F\u4E0A\u4E00\u4E2A\u8282\u70B9
        //\u8BA9\u4E0A\u4E00\u4E2A\u8282\u70B9\u7684\u53F3\u6307\u9488\u6307\u5411\u5F53\u524D\u8282\u70B9
        else if (pre != null) pre.right = root;
        //\u5C06\u5F53\u524D\u8282\u70B9\u7684\u505A\u6307\u9488\u6307\u5411\u7236\u8282\u70B9
        root.left = pre;
